// src/components/TeacherDashboard.js
import React, { useState } from 'react';
import CSVUpload from './CSVUpload';

function TeacherDashboard() {
  const [assignments, setAssignments] = useState([]);

  // Mock function to handle creating a new assignment (you can replace this with real logic)
  const createAssignment = () => {
    const newAssignment = { id: assignments.length + 1, title: `Assignment ${assignments.length + 1}` };
    setAssignments([...assignments, newAssignment]);
  };

  return (
    <div className="teacher-dashboard">
      <h1>Welcome, Teacher!</h1>
      <CSVUpload /> {/* Component to upload and parse CSV for group memberships */}

      <section>
        <h2>Assignments</h2>
        <button onClick={createAssignment}>Create New Assignment</button>
        <ul>
          {assignments.map((assignment) => (
            <li key={assignment.id}>{assignment.title}</li>
          ))}
        </ul>
      </section>

      <section>
        <h2>Manage Students</h2>
        <p>View and manage students in your classes here.</p>
        {/* You can add more features here, such as displaying student data, adding notes, etc. */}
      </section>
    </div>
  );
}

export default TeacherDashboard;
